import XCTest
import CoreGraphics
import GeoFeatures
import GeoFeaturesQuartz

private class DummyGeometry: Geometry {

    var precision: Precision = Floating()

    var coordinateSystem: CoordinateSystem = Cartesian()

    var dimension: GeoFeatures.Dimension = .zero

    func isEmpty() -> Bool {
        return true
    }

    func boundary() -> Geometry {
        return GeometryCollection()
    }

    func bounds() -> Bounds? {
        return nil
    }

    func equals(_ other: Geometry) -> Bool {
        return false
    }

    func equalsTopo(_ other: Geometry) -> Bool {
        return false
    }
}

class CGContextGeoFeaturesTests: XCTestCase {

    var context: CGContext? = nil

    override func setUp() {
        context = CGContext(data: nil, width: 128, height: 128, bitsPerComponent: 8, bytesPerRow: 0, space: CGColorSpaceCreateDeviceRGB(), bitmapInfo: CGBitmapInfo(rawValue: CGImageAlphaInfo.premultipliedLast.rawValue).rawValue)

        context?.setLineCap(CGLineCap.round)
        context?.setLineWidth(1.0)
        context?.setBlendMode(CGBlendMode.overlay)

        guard let strokeColor = CGColor(colorSpace: CGColorSpaceCreateDeviceRGB(), components: [77/255.0,  169/255.0, 255/255.0, 1.0] as [CGFloat]),
              let fillColor   = CGColor(colorSpace: CGColorSpaceCreateDeviceRGB(), components: [204/255.0,  230/255.0, 255/255.0, 1.0] as [CGFloat]) else {

            XCTFail("Failed to create fill and/or stroke color"); return

        }
        context?.setStrokeColor(strokeColor)
        context?.setFillColor  (fillColor)

        XCTAssertNotNil(context, "Could not create graphics context for tests.")
    }

    // MARK: - Point

    func testAddPoint() {
        let input = Point([3.0, 3.0])

        let expected = { () -> CGPath in
            let path = CGMutablePath()
            path.move(to: CGPoint(x: 3, y: 3))
            path.closeSubpath()

            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawPoint() {
        let input = Point([64.0, 64.0])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawPoint.png") { (context) -> Void in
            context?.setLineWidth(2.0)

            context?.draw(input)
        }
    }

    func testDrawPointAsGeometry() {
        let input = Point([64.0, 64.0])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawPointAsGeometry.png") { (context) -> Void in
            context?.setLineWidth(2.0)

            context?.draw(input as Geometry)
        }
    }

    // MARK: - LineString

    func testAddLineString() {
        let input = LineString([[100, 100], [100, 200], [200, 200], [200, 100], [100, 100]])

        let expected = { () -> CGPath in
            let path = CGMutablePath()
            path.move(to: CGPoint(x: 100, y: 100))
            path.addLine(to: CGPoint(x: 100, y: 200))
            path.addLine(to: CGPoint(x: 200, y: 200))
            path.addLine(to: CGPoint(x: 200, y: 100))
            path.addLine(to: CGPoint(x: 100, y: 100))
            path.closeSubpath()
            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawLineString() {
        let input = LineString([[1, 1], [1, 127], [127, 127], [127, 1], [1, 1]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawLineString.png", draw: { $0?.draw(input) })
    }

    func testDrawLineStringAsGeometry() {
        let input = LineString([[1, 1], [1, 127], [127, 127], [127, 1], [1, 1]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawLineStringAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - LinearRing

    func testAddLinearRing() {
        let input = LinearRing([[100, 100], [100, 200], [200, 200], [200, 100], [100, 100]])

        let expected = { () -> CGPath in
            let path = CGMutablePath()
            path.move(to: CGPoint(x: 100, y: 100))
            path.addLine(to: CGPoint(x: 100, y: 200))
            path.addLine(to: CGPoint(x: 200, y: 200))
            path.addLine(to: CGPoint(x: 200, y: 100))
            path.addLine(to: CGPoint(x: 100, y: 100))
            path.closeSubpath()
            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawLinearRing() {
        let input = LinearRing([[1, 1], [1, 127], [127, 127], [127, 1], [1, 1]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawLinearRing.png", draw: { $0?.draw(input) })
    }

    func testDrawLinearRingAsGeometry() {
        let input = LinearRing([[1, 1], [1, 127], [127, 127], [127, 1], [1, 1]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawLinearRingAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - Polygon

    func testAddPolygon() {
        let input = Polygon([[[0, 0], [60, 144], [120, 0], [0, 0]], [[40, 25], [80, 25], [60, 80], [40, 25]]])

        let expected = { () -> CGPath in
            let path = CGMutablePath()
            path.move(to: CGPoint(x: 0, y: 0))
            path.addLine(to: CGPoint(x: 60, y: 144))
            path.addLine(to: CGPoint(x: 120, y: 0))
            path.addLine(to: CGPoint(x: 0, y: 0))
            path.closeSubpath()
            path.move(to: CGPoint(x: 40, y: 25))
            path.addLine(to: CGPoint(x: 80, y: 25))
            path.addLine(to: CGPoint(x: 60, y: 80))
            path.addLine(to: CGPoint(x: 40, y: 25))
            path.closeSubpath()
            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawPolygon() {
        let input = Polygon([[[1, 1], [64, 128], [128, 1], [1, 1]], [[32, 20], [96, 20], [64, 86], [32, 20]]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawPolygon.png", draw: { $0?.draw(input) })
    }

    func testDrawPolygonAsGeometry() {
        let input = Polygon([[[1, 1], [64, 128], [128, 1], [1, 1]], [[32, 20], [96, 20], [64, 86], [32, 20]]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawPolygonAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - MultiPoint

    func testAddMultiPoint() {
        let input = MultiPoint([[2.0, 2.0], [3.0, 3.0]])

        let expected = { () -> CGPath in
            let path = CGMutablePath()
            path.move(to: CGPoint(x: 2, y: 2))
            path.closeSubpath()
            path.move(to: CGPoint(x: 3, y: 3))
            path.closeSubpath()

            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawMultiPoint() {
        let input = MultiPoint([[60.0, 60.0], [68.0, 60.0]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawMultiPoint.png") { (context) -> Void in
            context?.setLineWidth(2.0)

            context?.draw(input)
        }
    }

    func testDrawMultiPointAsGeometry() {
        let input = MultiPoint([[60.0, 60.0], [68.0, 60.0]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawMultiPointAsGeometry.png") { (context) -> Void in
            context?.setLineWidth(2.0)

            context?.draw(input as Geometry)
        }
    }

    // MARK: - MultiLineString

    func testAddMultiLineString() {
        let input = MultiLineString([[[100.00, 200.00], [150.00, 100.00], [125.00, 100.00]], [[200.00, 200.00], [250.00, 100.00], [225.00, 100.00]]])

        let expected = { () -> CGPath in
            let path = CGMutablePath()
            path.move(to: CGPoint(x: 100, y: 200))
            path.addLine(to: CGPoint(x: 150, y: 100))
            path.addLine(to: CGPoint(x: 125, y: 100))
            path.move(to: CGPoint(x: 200, y: 200))
            path.addLine(to: CGPoint(x: 250, y: 100))
            path.addLine(to: CGPoint(x: 225, y: 100))
            return path
        }()
        
        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawMultiLineString() {
        let input = MultiLineString([[[1, 1], [1, 60], [60, 60], [60, 1], [1, 1]], [[64, 1], [64, 127], [127, 127], [127, 1], [64, 1]]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawMultiLineString.png", draw: { $0?.draw(input) })
    }

    func testDrawMultiLineStringAsGeometry() {
        let input = MultiLineString([[[1, 1], [1, 60], [60, 60], [60, 1], [1, 1]], [[64, 1], [64, 127], [127, 127], [127, 1], [64, 1]]])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawMultiLineStringAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - MultiPolygon

    func testAddMultiPolygon() {
        let input = MultiPolygon([Polygon([[[0, 0], [60, 144], [120, 0], [0, 0]], [[40, 25], [80, 25], [60, 80], [40, 25]]]), Polygon([[[130, 0], [190, 144], [260, 0], [130, 0]], [[170, 25], [210, 25], [190, 80], [170, 25]]])])

        let expected = { () -> CGPath in
            let path = CGMutablePath()

            /// Poly 1
            path.move(to: CGPoint(x: 0, y: 0))
            path.addLine(to: CGPoint(x: 60, y: 144))
            path.addLine(to: CGPoint(x: 120, y: 0))
            path.addLine(to: CGPoint(x: 0, y: 0))
            path.closeSubpath()
            path.move(to: CGPoint(x: 40, y: 25))
            path.addLine(to: CGPoint(x: 80, y: 25))
            path.addLine(to: CGPoint(x: 60, y: 80))
            path.addLine(to: CGPoint(x: 40, y: 25))
            path.closeSubpath()

            /// Poly 2
            path.move(to: CGPoint(x: 130, y: 0))
            path.addLine(to: CGPoint(x: 190, y: 144))
            path.addLine(to: CGPoint(x: 260, y: 0))
            path.addLine(to: CGPoint(x: 130, y: 0))
            path.closeSubpath()
            path.move(to: CGPoint(x: 170, y: 25))
            path.addLine(to: CGPoint(x: 210, y: 25))
            path.addLine(to: CGPoint(x: 190, y: 80))
            path.addLine(to: CGPoint(x: 170, y: 25))
            path.closeSubpath()

            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawMultiPolygon() {
        let input = MultiPolygon([Polygon([[[1, 1], [60, 128], [60, 1], [1, 1]]]), Polygon([[[64, 1], [64, 128], [128, 1], [64, 1]]])])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawMultiPolygon.png", draw: { $0?.draw(input) })
    }

    func testDrawMultiPolygonAsGeometry() {
        let input = MultiPolygon([Polygon([[[1, 1], [60, 128], [60, 1], [1, 1]]]), Polygon([[[64, 1], [64, 128], [128, 1], [64, 1]]])])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawMultiPolygonAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - GeometryCollection

    func testAddGeometryCollection() {
        let input = GeometryCollection([LineString([[3, 3], [60, 60], [120, 3]]), MultiPoint([[3, 3], [60, 60], [120, 3]])])

        let expected = { () -> CGPath in
            let path = CGMutablePath()

            /// LineString 1
            path.move(to: CGPoint(x: 3, y: 3))
            path.addLine(to: CGPoint(x: 60, y: 60))
            path.addLine(to: CGPoint(x: 120, y: 3))

            /// MultiPoint
            path.move(to: CGPoint(x: 3, y: 3))
            path.closeSubpath()
            path.move(to: CGPoint(x: 60, y: 60))
            path.closeSubpath()
            path.move(to: CGPoint(x: 120, y: 3))
            path.closeSubpath()

            return path
        }()

        context?.add(input)

        XCTAssertEqual(context?.path, expected)
    }

    func testDrawGeometryCollection() {
        let input = GeometryCollection([LineString([[3, 3], [60, 60], [120, 3]]), MultiPoint([[3, 3], [60, 60], [120, 3]])])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawGeometryCollection.png", draw: { $0?.draw(input) })
    }

    func testDrawGeometryCollectionAsGeometry() {
        let input = GeometryCollection([LineString([[3, 3], [60, 60], [120, 3]]), MultiPoint([[3, 3], [60, 60], [120, 3]])])
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawGeometryCollectionAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - Negative draw tests

    func testDrawDummyGeometryAsGeometry() {
        let input: Geometry = DummyGeometry()
        let expected = ""

        self._testDraw(expected, verificationFileName: "TestDrawDummyGeometryAsGeometry.png", draw: { $0?.draw(input as Geometry) })
    }

    // MARK: - Private test methods
    
    func _testDraw(_ expected: String, verificationFileName: String, draw: (CGContext?) -> Void) {

        draw(self.context)

        guard let image = context?.makeImage(), let data = image.dataProvider?.data
            else { XCTFail("Failed to create image/data from context for test."); return }

        /// Note: to save a visual verification png file, set SAVE_VERIFICATION_IMAGE for the build.
        #if SAVE_VERIFICATION_IMAGE
        self.writeCGImage(image, to: verificationFileName)
        #endif

        XCTAssertEqual((data as Data).base64EncodedString(), expected)
    }
}

extension CGContextGeoFeaturesTests {

    @discardableResult
    private func writeCGImage(_ image: CGImage, to destinationPath: String) -> Bool {
        guard let destination = CGImageDestinationCreateWithURL(URL(fileURLWithPath: destinationPath) as CFURL, "public.png" as CFString, 1, nil)
            else { return false }

        CGImageDestinationAddImage(destination, image, nil)

        return CGImageDestinationFinalize(destination)
    }
}

#endif
